import './App.css';

const App = () => {
  return (
    <div>
      <div></div>
    <div className="App">
      <ul>
        <li>First</li>
        <li>Second</li>
        <li>Third</li>
        <li>Fourth</li>
      </ul>
    </div>
    </div>
  );
}
const Header = () => {
  return (
    <div>
      <a href="#s">Home </a>
      <a href="#s">New Page </a>
      <a href="#s">Message </a>
    </div>
  );
}

export default App;
